import './Css/feedback.css';
import React from 'react';
import Select from 'react-select';
import Aside from '../Quizz - 01/Aside/Aside';
import Main from '../Main/Main';
import { hover } from '@testing-library/user-event/dist/hover';

function Feedback() {
    const assunto = [
        {value: 'Bugs', label: 'Bugs'},
        {value: 'Como podemos melhorar', label: 'Como podemos melhorar'},
        {value: 'Elogios', label: 'Elogios'},
    ];
    const day = [
        {value: '01', label: '01'},
        {value: '02', label: '02'},
        {value: '03', label: '03'},
        {value: '04', label: '04'},
        {value: '05', label: '05'},
        {value: '06', label: '06'},
        {value: '07', label: '07'},
        {value: '08', label: '08'},
        {value: '09', label: '09'},
        {value: '10', label: '10'},
        {value: '11', label: '11'},
        {value: '12', label: '12'},
        {value: '13', label: '13'},
        {value: '14', label: '14'},
        {value: '15', label: '15'},
        {value: '16', label: '16'},
        {value: '17', label: '17'},
        {value: '18', label: '18'},
        {value: '19', label: '19'},
        {value: '20', label: '20'},
        {value: '21', label: '21'},
        {value: '22', label: '22'},
        {value: '23', label: '23'},
        {value: '24', label: '24'},
        {value: '25', label: '25'},
        {value: '26', label: '26'},
        {value: '27', label: '27'},
        {value: '28', label: '28'},
        {value: '29', label: '29'},
        {value: '30', label: '30'},
        {value: '31', label: '31'},
    ];
    const month = [
        {value: 'Janeiro', label: 'Janeiro'},
        {value: 'Fevereiro', label: 'Fevereiro'},
        {value: 'Março', label: 'Março'},
        {value: 'Abril', label: 'Abril'},
        {value: 'Maio', label: 'Maio'},
        {value: 'Junho', label: 'Junho'},
        {value: 'Julho', label: 'Julho'},
        {value: 'Agosto', label: 'Agosto'},
        {value: 'Setembro', label: 'Setembro'},
        {value: 'Outubro', label: 'Outubro'},
        {value: 'Novembro', label: 'Novembro'},
        {value: 'Dezembro', label: 'Dezembro'},
    ];
    const year = [
        {value: '2005', label: '2005'},
        {value: '2006', label: '2006'},
        {value: '2007', label: '2007'},
        {value: '2008', label: '2008'},
        {value: '2009', label: '2009'},
        {value: '2010', label: '2010'},
        {value: '2011', label: '2011'},
        {value: '2012', label: '2012'},
        {value: '2013', label: '2013'},
        {value: '2014', label: '2014'},
        {value: '2015', label: '2015'},
        {value: '2016', label: '2016'},
        {value: '2017', label: '2017'},
        {value: '2018', label: '2018'},
        {value: '2019', label: '2019'},
        {value: '2020', label: '2020'},
        {value: '2021', label: '2021'},
        {value: '2022', label: '2022'},
        {value: '2023', label: '2023'},
    ]
    return (
        <div className='Feedback'>
            <Aside />
            <Main>
                <div className='feedback_content'>
                    <h1>Conte-nos a sua opinião!</h1>
                    <form method='post' className='form_cont'>
                        <div className='form_name'>
                            <input type='text' placeholder='Nome...' />
                            <input type='text' placeholder='Sobrenome...' />
                        </div>{/* form_name */}
                        <div className='form_info'>
                            <input type='email' placeholder='Seu email...' />
                            <div className='container'>
                                <Select
                                    options={assunto}
                                    placeholder={'Escolha uma opção...'}
                                    styles={{
                                        control: (defaultStyles, state) => ({
                                            ...defaultStyles,
                                            borderColor: state.isFocused ? 'blue' : 'grey',
                                            border: '2px solid #6940e7',
                                            borderRadius: '20px',
                                            paddingLeft: '5px',
                                            width: '400px',
                                            margin: '10px 0',
                                            height: '38px',
                                            transition: '0.7s',
                                            cursor: 'pointer',
                                        }),
                                        placeholder: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '-11px',
                                            color: '#6940e7',
                                        }),
                                        valueContainer: (defaultStyles) => ({
                                            ...defaultStyles,
                                            height: '30px',
                                        }),
                                        indicatorSeparator: (defaultStyles) => ({
                                            ...defaultStyles,
                                            height: '55%',
                                            marginTop: '7.5px',
                                            backgroundColor: '#6940e7',
                                        }),
                                        dropdownIndicator: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '0',
                                            color: '#6940e7',
                                        }),
                                        singleValue: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '-11px',
                                            color: '#6940e7',
                                        }),
                                        option: (defaultStyles, state) => ({
                                            ...defaultStyles,
                                            cursor: 'pointer',
                                            transition: '0.7s',
                                            color: state.isFocused ? 'white' : '#6940e7',
                                            backgroundColor: state.isFocused ? '#6940e7' : 'white',
                                        }),
                                        input: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '-8px',
                                        })
                                    }}
                                />
                            </div>    
                            <textarea placeholder='Menssagem...'></textarea>
                        </div>{/* form_info */}
                        <div className='form_gender'>
                            <p>Como você se identifica?</p>
                            <div className='form_gender_inputCont'>
                                <input id='masculino' type='radio' name='genero' />
                                <label htmlFor='masculino'></label>
                                <span>Masculino</span>
                            </div>{/* form_gender_inputCont */}
                            <div className='form_gender_inputCont'>
                                <input id='feminino' type='radio' name='genero' />
                                <label htmlFor='feminino'></label>
